  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Presquile
  NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions and
  land acquisition activities. The master plan and research and investigations are
  summarized. Administration topics are included; topics include personnel, youth
  programs, volunteer programs, funding, and safety. Habitat management is covered;
  wetlands, forests, croplands, grasslands, haying, and pest control are discussed.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh and water birds, shorebirds, raptors, other
  migratory birds, game mammals, other resident wildlife, fisheries resources, and
  marking and banding. Interpretation and recreation activities are outlined; topics
  include outdoor classrooms, interpretative exhibits, wildlife observation, other
  non-wildlife oriented recreation, and law enforcement. Equipment and facilities
  are discussed; subjects include rehabilitation, equipment utilization and replacement,
  and communications systems. Cooperative programs, items of interest, and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
